import { useState } from "react";

import "./Landing.css";

import { Profile as ProfileModel } from "../../models/profile/Profile";
import Navbar from "../../components/navbar/Navbar";
import Profiles from "../../components/profiles/Profiles";
import Browse from "../browse/Browse";


function Landing() {
  const [avatar, setAvatar] = useState<ProfileModel | undefined>(undefined);

  function onProfileClick(profile: ProfileModel) {
    setAvatar((avatar) => profile);
    localStorage.setItem('avatar', 'avatar');
  }

  return (
    <div className="landing-container">
      <Navbar only_logo={localStorage.getItem('avatar') !== 'avatar'} profile_url={avatar?.image_src} />
      {localStorage.getItem('avatar') !== 'avatar' ? (
        <Profiles onProfileClick={onProfileClick} />
      ) : (
        <>
          <Browse />
        </>
      )}
    </div>
  );
}

export default Landing;
